import './App.css';
import Nav from './Nav';
import Home from './components/Home';
import Footer from './Footer';
import { BrowserRouter as Router, Route, Routes} from 'react-router-dom';

function App() {
  return (
    <Router>
      <Nav/>
      <Routes>
        <Route path='/' element={<Home/>}></Route>

      </Routes>
      <Footer/>
    </Router>
  );
}

export default App;
